// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Default from './Pages/Default';
import Login from './Pages/Login';
import Home from './Pages/Home';
import MediaUpload from './Pages/MediaUpload';
import UserProfile from './Pages/UserProfile';
import Navbar from './routes/Navbar';
import Register from './Pages/Register';
import { useAuth } from './hooks/useAuth';

const App = () => {
  console.log('Rendering App component.');

  const { isAuthenticated } = useAuth();

  // Helper function to render protected routes
  const renderProtectedRoute = (element) => {
    return isAuthenticated ? element : <Navigate to="/Home" replace />;
  };

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Default />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />

        {/* Use render function for routes that require authentication */}
        <Route path="/Home" element={renderProtectedRoute(<><Navbar /><Home /></>)} />
        <Route path="/MediaUpload" element={renderProtectedRoute(<><Navbar /><MediaUpload /></>)} />
        <Route path="/UserProfile" element={renderProtectedRoute(<><Navbar /><UserProfile /></>)} />
      </Routes>
    </Router>
  );
};

export default App;
